import React from "react";
import ExampleResponse from  "../data/exampleresponse.json"


export const Video = () => {


let listThem = ExampleResponse.map(object => {
   return object.url.substring(32,object.url.length)
})



return (
    <div>
        {listThem.map(val => {
            return <iframe className="" width="355" height="200" src={`https://www.youtube.com/embed/${val}`} title="YouTube video player" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>
        })}
    </div>
)
}
